import React from 'react';

function Images({array}){

  let imagesArray=  array.map( (x,i) => {
        return(
        <a 
            key={i} 
            href={x.links.html} 
            target={'_blank'}
            >
                <img 
                    ref={x.urls.reqular} 
                    alt={x.alt_description} 
                    title={x.alt_description} 
                />
         </a>)
    });
    return(
    <div className="image-container shadow-6 mh8">
        {imagesArray}
    </div>
    );
}




export default Images;
